import './App.css';
import 'semantic-ui-css/semantic.min.css'
import { Container } from 'semantic-ui-react';
import Dasboard from './layouts/Dasboard';

function App() {
  return (
    <div className="App">
      <Container className="main">
      <Dasboard></Dasboard>

      </Container>
    </div>
  );
}

export default App;
